import React from 'react';

const CustomerServicePage = () => (
    <div className="generic-page">
        <h1>Customer Service</h1>
        <p>Welcome to our help center. We're here to assist you with any questions or issues you may have.</p>
        <h2>Frequently Asked Questions</h2>
        <p>Find answers to common questions about your orders, returns, payments, and account.</p>
        <h2>Contact Us</h2>
        <p>If you can't find the answer you're looking for, feel free to reach out to our support team 24/7.</p>
    </div>
);

export default CustomerServicePage;
